INSERT INTO `settings` (`id`, `name`, `value`) VALUES
(1, 'ticket', '<table border=\\"0\\" width=\\"830\\">\n <tbody>\n  <tr>\n   <td width=\\"830\\">\n    <h3 align=\\"center\\">\n     КВИТАНЦІЯ № [nomer_kvitancy]</h3>\n    <b>Сервісний Центр</b>&nbsp;&laquo;[name_sc]&raquo;<br>\n    <b>Наши реквізити:</b> [adres_sc], [phone_sc]<br />\n    <b>Графік роботи:</b> [rab_sc]</td>\n  </tr>\n </tbody>\n</table>\n<table border=\\"0\\" width=\\"830\\">\n <tbody>\n  <tr>\n   <td>\n    <p>\n     <b>Найменування:</b> [id_aparat] [id_proizvod] [model]\n     <b>Серійний №:</b> [ser_nomer]<br />\n     <b>Вид ремонту:</b> [id_remonta]<br />\n     <b>Дата прийому в ремонт:</b> [date_priemka]<br />\n     <b>Заявлена несправність, зі слів замовника:</b>&nbsp;[neispravnost]<br />\n     <b>Зовнішній вигляд апарата:</b> [vid]<br />\n     <b>Комплектність:</b> [komplektnost]<br />\n     <b>Контакти замовника:</b>&nbsp;&nbsp;&nbsp;Телефон: [phone]<br />\n     <b>П. І. П. замовника:</b> [fam] [imya] [otch], адреса: [adres]</p>\n   </td>\n  </tr>\n </tbody>\n</table>\n\n\n<table border="0" width="830">\n			<tr>\n		<td>\n<font size="1">\n1. Виріб приймається в ремонт у чистому,  зібраному та укомплектованому вигляді. При здачі в ремонт обговорюється вид ремонту що виконується без узгодження вартості. Оплата за роботу проводиться після виконання ремонту з урахуванням вартості запчастин та вартості роботи за результатом діагностики та попереднього узгодження.<br>\n\n2. Ремонт здійснюється тільки згідно дефекту виявленого при прийманні та перевіряється на заявлений дефект. Якщо дефект не вказаний - перевіряється тільки на включення та працездатність. Сервісний центр не несе відповідальності за можливий прояв в техніці дефектів, не зазначених у квитанції, можливої повної або часткової втрати працездатності апарату або окремих його вузлів і блоків у процесі ремонту; в разі грубих порушень користувачем умов експлуатації апаратури, наявності слідів корозії, потрапляння вологи або механічних ушкоджень, а так само слідів некваліфікованого ремонту апарату, часткову або повну втрату інформації, а також за будь-який прямий або непрямий збиток, понесений клієнтом або третіми особами у разі непрацездатності обладнання.<br>\n\n3. Після ремонту техніки яка не вмикалась при здачі в сервісних центр, усунення всіх виявлених пізніше додаткових дефектів сплачуються окремо.<br>\n\n4. Не приймаються претензії щодо додатково виявлених дефектів після відновлення працездатності пристроїв, що не вмикалися при здачі в ремонт, тому що, не могли бути перевірені до моменту ремонту. (Батарея, блок живлення, блутуз, веб-камера, мікрофон, звукова система, тачпад, USB порти, DVD привод, WiFi модуль, клавіш, екрану тощо)<br>\n\n5. Техніка при видачі обов’язково вмикається в присутності Замовника та демонструються результати ремонту.<br>\n\n6. Гарантія надається тільки на виконану роботу і тільки на усунення вказаної несправності. Якщо при подальшому зверненні в ремонт вийшли з ладу блоки/елементи з іншої категорії або заявлений інший дефект - він сплачується окремо.<br>\n\n\n7. При відмові від ремонту клієнт сплачує діагностику технічного стану апарату в розмірі відповідно до прайсу.<br>\n\n8. За встановлене програмне забезпечення (ліцензійність, працездатність тощо), а також за всі данні які знаходяться на носіях апарату відповідає Замовник.<br>\n\n9. Форс-мажор. Надзвичайна і непереборна подія, що звільняє від відповідальності за виконання даного договору. До таких подій відносяться: стихійні лиха, збройні конфлікти, транспортні проблеми, дії влади, пожежі, потопи, протиправні дії третіх осіб (крадіжки, пошкодження, та все що суперечить чинному законодавству України).<br>\n\n<br>\n		</font>\n		</td>\n	</tr>\n</table>\n\n<table border="0" width="830">\n			<tr>\n		<td>\n<font size="1">\n<center><b>Умови виїзного ремонту</b></center>\n		</font>\n		<font size="1">\n		1. Сервісний Центр надає послуги виїзного ремонту в офісі або квартирі замовника.<br>\n\n		2. Умови ремонту, діагностики, приймання та зберігання техніки повністю відповідають умовам цьому договору.<br>\n\n		3. При виїзному ремонті діагностика будь якої техніки є послуга платна, та складає 200 грн.<br>\n\n		</font>\n		</td>\n	</tr>\n</table>\n\n\n\n<table border="0" width="830">\n			<tr>\n		<td>\n<font size="1">\n<center><b>Види робіт на які не поширюється гарантія</b></center>\n		</font>\n		<font size="1">\n		1. Прошивка bios, зняття пароля.<br>\n\n2. Заміна запобіжників, усунення коротких замикань на будь яких платах.<br>\n\n3. Заміна компонентів, наданих Замовником.<br>\n\n4. Будь які види ремонту, при яких виявлено порушення умов експлуатації техніки (вирвані та потемнілі мікросхеми, вигорілі доріжки, елементи, сліди перегріву і втручання некомпетентних осіб, тощо)<br>\n\n5. Будь які чистки,  апаратна профілактика.<br>\n\n6. Будь які роботи з ремонту залитої техніки.<br>\n\n7. Будь які роботи з ремонту техніки після інших сервісних центрів.<br>\n\n8. Будь які роботи з ремонту техніки з виявленими механічними пошкодженнями (які мають ознаки падіння, ударів, тріщини, відколи корпусу, тощо)<br>\n		</font>\n		</td>\n	</tr>\n</table>\n\n<table border="0" width="830">\n			<tr>\n		<td>\n<font size="1">\n<center><b>Причини відмови у гарантійному ремонті</b></center>\n		</font>\n		<font size="1">\n		1. При порушенні гарантійних пломб, наклейок, стікерів, при виявленні слідів їх переклеювання або ремаркування.<br>\n\n2. При наявності механічних, електротехнічних, хімічних пошкоджень поверхні виробу або його компонентів (видимі зміни кольору компонентів, здутості, відколи, вм''ятини), а також за наявності ушкоджень, викликаних використанням нестандартних витратних матеріалів і запчастин.<br>\n\n3. При пошкодженнях на корпусі виробу, які можуть бути витлумаченні як сліди удару.<br>\n\n4. При порушеннях правил експлуатації (неправильність підключення, подача неправильних напруги живлення, "гаряче" підключення, ігнорування правил електростатичної безпеки тощо).<br>\n\n5. При наявності слідів стороннього втручання або виконання ремонту сторонніми особами;<br>\n\n6. При попаданні всередину виробу сторонніх предметів, рідин, вологи, комах.<br>\n\n7. При внесенні змін у конструкцію виробу.<br>\n\n8. Якщо замовником не було продемонстровано працездатність всіх встановлених периферійних пристроїв апарату під час здачі в ремонт, а саме: батарея, блок живлення, блутуз, веб-камера, мікрофон, звукова система, тачпад, USB порти, DVD привод, WiFi модуль, клавіш, екрану, петель, роз''ємів тощо.<br>\n		</font>\n		</td>\n	</tr>\n</table>\n\n</table>\n\n<table border=\\"0\\" width=\\"830\\">\n <tbody>\n  <tr>\n   <td>\n    З умовами прийому, ремонту, зберігання згоден.<br />\n    [fam] [imya] [otch]</td>\n   <td  left;\\">\n    Представник СЦ&nbsp; [name_sc]</td>\n  </tr>\n  <tr>\n   <td>\n    <br />\n    ___________________________</td>\n   <td>\n    <br />\n    ___________________________</td>\n  </tr>\n </tbody>\n</table>\n'),
(3, 'check', '\n<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN">\n<html>\n<head>\n	<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">\n	<title>Печать чека СЦ [name_sc] - Ремонт компьютерной и бытовой техники в Киеве</title>\n\n	<script type="text/javascript">\n	var bIsFirebugReady = (!!window.console && !!window.console.log);\n\n	$(document).ready(\n		function (){\n			// update the plug-in version\n			$("#idPluginVersion").text($.Calculation.version);\n\n/*			\n			$.Calculation.setDefaults({\n				onParseError: function(){\n					this.css("backgroundColor", "#cc0000")\n				}\n				, onParseClear: function (){\n					this.css("backgroundColor", "");\n				}\n			});\n*/\n			\n			// bind the recalc function to the quantity fields\n			$("input[id^=price_item_]").bind("keyup", recalc);\n			$("input[name^=qty_item_]").bind("keyup", recalc);\n			\n			// run the calculation function now\n			recalc();\n\n			// automatically update the "#totalSum" field every time\n			// the values are changes via the keyup event\n			$("input[name^=sum]").sum("keyup", "#totalSum");\n			\n			// automatically update the "#totalAvg" field every time\n			// the values are changes via the keyup event\n			$("input[name^=avg]").avg({\n				bind:"keyup"\n				, selector: "#totalAvg"\n				// if an invalid character is found, change the background color\n				, onParseError: function(){\n					this.css("backgroundColor", "#cc0000")\n				}\n				// if the error has been cleared, reset the bgcolor\n				, onParseClear: function (){\n					this.css("backgroundColor", "");\n				}\n			});\n\n			// automatically update the "#minNumber" field every time\n			// the values are changes via the keyup event\n			$("input[name^=min]").min("keyup", "#numberMin");\n\n			// automatically update the "#minNumber" field every time\n			// the values are changes via the keyup event\n			$("input[name^=max]").max("keyup", {\n				selector: "#numberMax"\n				, oncalc: function (value, options){\n					// you can use this to format the value\n					$(options.selector).val(value);\n				}\n			});\n\n			// this calculates the sum for some text nodes\n			$("#idTotalTextSum").click(\n				function (){\n					// get the sum of the elements\n					var sum = $(".textSum").sum();\n\n					// update the total\n					$("#totalTextSum").text("$" + sum.toString());\n				}\n			);\n\n			// this calculates the average for some text nodes\n			$("#idTotalTextAvg").click(\n				function (){\n					// get the average of the elements\n					var avg = $(".textAvg").avg();\n\n					// update the total\n					$("#totalTextAvg").text(avg.toString());\n				}\n			);\n		}\n	);\n	\n	function recalc(){\n		$("[id^=total_item]").calc(\n			// the equation to use for the calculation\n			"qty * price",\n			// define the variables used in the equation, these can be a jQuery object\n			{\n				qty: $("input[name^=qty_item_]"),\n				price: $("[id^=price_item_]")\n			},\n			// define the formatting callback, the results of the calculation are passed to this function\n			function (s){\n				// return the number as a dollar amount\n				return s.toFixed(2);\n			},\n			// define the finish callback, this runs after the calculation has been complete\n			function ($this){\n				// sum the total of the $("[id^=total_item]") selector\n				var sum = $this.sum();\n				\n				$("#grandTotal").text(\n					// round the results to 2 digits\n					sum.toFixed(2) + "грн. БЕЗ ПДВ."\n				);\n			}\n		);\n	}\n	\n	\n\n	\n	\n	</script>\n\n	<style type="text/css">\n		#testForm {\n			width: 800px;\n		}\n\n		code {\n			background-color: #e0e0e0;\n		}\n\n		#formContent p {\n			clear: both;\n			min-height: 20px;\n		}\n\n		#idCheckboxMsg{\n			color: red;\n			font-weight: bold;\n		}\n\n		#totalTextSum,\n		.textSum,\n		#totalTextAvg,\n		.textAvg {\n			border: 1px solid black;\n			padding: 2px;\n		}\n		\n		#panel {    \n			overflow: hidden;\n			\n			padding: 5px;\n			\n			}\n		.panel {\n			\n			}\n		.panel {\n			\n			}\n				\n	</style>\n\n</head>\n<body>\n\n<table border="0" width="100%" id="table3">\n	<tr>\n		<td><font size="5">Сервісний Центр </font> <i><b><font size="5">[name_sc] - Ремонт компьютерной и бытовой техники в Киеве</font></b></i><p>\n<font style="font-size: 12pt">[adres_sc] </font> <br>\n</p>\n<p>\n[phone_sc]</p>\n\n\n<p align="center">\n&nbsp;&nbsp;\n<b>ТОВАРНИЙ ЧЕК</b> \n№ [nomer_kvitancy] від [date]</p>\n		<p>&nbsp;</td>\n	</tr>\n</table>\n			<hr />\n<table>\n			<table width="500">\n				<col style="width: 50px;" />\n				<col />\n				<col style="width: 60px;" />\n				<col style="width: 110px;" />\n				<tr>\n					\n					<th align="center">\n						Найменування\n					</th>\n					<th>\n						Кількість\n					</th>\n					<th>\n						Ціна\n					</th>\n					<th>\n						Сума\n					</th>\n				</tr>\n				\n				<tr>\n					\n					<td>\n						<input type="text" size="100" value="Ремонт [чего именно нужно написать,например, материнской платы] [id_aparat] [id_proizvod] [model]"</input>\n					</td>\n					<td align="center">\n						<input type="text" name="qty_item_1" id="qty_item_1" value="1" size="2" />\n					</td>\n					<td align="center">\n						<input   size="5"  id="price_item_1 type="text"></input>\n					</td>\n					<td align="center" id="total_item_1">\n						\n					</td>\n				</tr>\n		\n		\n				\n				\n				\n				\n				<tr>\n				\n				\n					\n					<td>\n						<input type="text" size="100"</input>\n					</td>\n					<td align="center">\n						<input type="text" name="qty_item_2" id="qty_item_2" size="2" />\n					</td>\n					<td align="center">\n						<input size="5" id="price_item_2 type="text"></input>\n					</td>\n					<td align="center" id="total_item_2">\n						\n					</td>\n		\n				</tr>\n\n\n				\n				<tr>\n				\n				\n					\n					<td>\n						<input type="text" size="100"</input>\n					</td>\n					<td align="center">\n						<input type="text" name="qty_item_3" id="qty_item_3" size="2" />\n					</td>\n					<td align="center">\n						<input size="5" id="price_item_3 type="text"></input>\n					</td>\n					<td align="center" id="total_item_3">\n						\n					</td>\n		\n				</tr>\n				\n				\n				\n				<tr>\n				\n				\n					\n					<td>\n						<input type="text" size="100"</input>\n					</td>\n					<td align="center">\n						<input type="text" name="qty_item_4" id="qty_item_4" size="2" />\n					</td>\n					<td align="center">\n						<input size="5" id="price_item_4 type="text"></input>\n					</td>\n					<td align="center" id="total_item_4">\n						\n					</td>\n		\n				</tr>\n				\n				\n				\n				<tr>\n					<td colspan="3" align="right">\n						<strong>Всього:</strong>\n					</td>\n					<td align="center" id="grandTotal">\n					</td>\n				</tr>\n			</table>\n	\n		<hr />\n	</fieldset>\n	\n\n<input type="text" value="Гарантія:" size="200"</input>\n\n		<center><b>Види робіт на які не поширюється гарантія</b></center>\n		<table border="0" width="830">\n            <tbody><tr>\n        <td>\n        1. Прошивка bios, зняття пароля.<br>\n2. Заміна запобіжників, усунення коротких замикань на будь яких платах.<br>\n3. Заміна компонентів, наданих Замовником.<br>\n4. Будь які види ремонту, при яких виявлено порушення умов експлуатації техніки (вирвані та потемнілі мікросхеми, вигорілі доріжки, елементи, сліди перегріву і втручання некомпетентних осіб, тощо)<br>\n5. Будь які чистки,  апаратна профілактика.<br>\n6. Будь які роботи з ремонту залитої техніки.<br>\n7. Будь які роботи з ремонту техніки після інших сервісних центрів.<br>\n8. Будь які роботи з ремонту техніки з виявленими механічними пошкодженнями (які мають ознаки падіння, ударів, тріщини, відколи корпусу, тощо)<br>\n        </td>\n    </tr>\n</tbody></table>\n<center><b>Причини відмови у гарантійному ремонті</b></center>\n\n<table border="0" width="830">\n            <tbody><tr>\n        <td>\n        1. При порушенні гарантійних пломб, наклейок, стікерів, при виявленні слідів їх переклеювання або резкштмаркування.<br>\n2. При наявності механічних, електротехнічних, хімічних пошкоджень поверхні виробу або його компонентів (видимі зміни кольору компонентів, здутості, відколи, вм''ятини), а також за наявності ушкоджень, викликаних використанням нестандартних витратних матеріалів і запчастин.<br>\n3. При пошкодженнях на корпусі виробу, які можуть бути витлумаченні як сліди удару.<br>\n4. При порушеннях правил експлуатації (неправильність підключення, подача неправильної напруги живлення, "гаряче" підключення, ігнорування правил електростатичної безпеки тощо).<br>\n5. При наявності слідів стороннього втручання або виконання ремонту сторонніми особами;<br>\n6. При попаданні всередину виробу сторонніх предметів, рідин, вологи, комах.<br>\n7. При внесенні змін у конструкцію виробу.<br>\n8. Якщо замовником не було продемонстровано працездатність всіх встановлених периферійних&nbsp;пристроїв апарату під час здачі&nbsp;в ремонт, а саме:&nbsp;батарея,&nbsp;блок живлення, блутуз, веб-камера, мікрофон, звукова система, тачпад, USB&nbsp;порти,&nbsp;DVD&nbsp;привод, WiFi модуль, клавіш, екрану, петель, роз''ємів&nbsp;тощо.<br>\n        </td>\n    </tr>\n\n\n<tr>\n<td>\n\n		Гарантія надається ТІЛЬКИ на виконанну роботу, а не на весь пристрій \n		вцілому. <br>\n		<br>\n		Техніку оглянув, перевірив та отримав.<span lang="ru"> </span> <br>\n		[fam] [imya] [otch], тел.: [phone], [adres] <br>\n		Претензій не маю __________________________ \n</td>\n</tr>\n</tbody></table>\n\n</body>\n</html>\n\n'),
